const Social = ({ inconClass, link, text }) => {
  return (
    <li class="mb-3">
      <a href={link}>
        <span class="fa-container text-center mr-2">
          <i class={iconClass}></i>
        </span>
        {text}
      </a>
    </li>
  );
};

export default Social;
